import Detail from "../../data/detail.json";
const DelailList = () => {
  return (
    <div>
      <div>
        <h1>{coll.name}</h1>
        <button>Reserve or Book Now</button>
      </div>
      <p>{coll.address}</p>
      <h4>{coll.distance}</h4>
      <h4>{coll.price}</h4>
      <img src={coll.photos} alt={Detail.index}></img>
      <h1>{coll.title}</h1>
      <p>{coll.description}</p>
    </div>
  );
};
export default DelailList;
